import SystemAppHeader from "../../../../Components/SystemAppHeader.vue";
import SystemFilter from "../../../../Components/SystemFilter.vue";
import PhoneAppListItem from "../Components/PhoneAppListItem";
export default {
  data() {
    return {
      headerOptions: ["Все", "Пропущ."],
      selectedOption: "Все"
    };
  },
  components: {
    SystemAppHeader,
    SystemFilter,
    PhoneAppListItem
  },
  computed: {
    recentlyCalls() {
      return this.$store.getters["phone/getRecentlyCalls"];
    },
    filteredRecentlyCalls() {
      if (this.selectedOption === "Все") {
        return this.recentlyCalls;
      }
      return this.recentlyCalls.filter(call => {
        return !call.isAccepted && call.isIncoming;
      });
    },
    contacts() {
      return this.$store.getters["phone/getContacts"];
    },
    numbers() {
      return this.$store.getters["phone/getNumbers"];
    }
  },
  methods: {},
  mounted() {}
};
